// src/components/Navbar.js
import React, { useState } from 'react';
import { Link } from 'react-scroll';
import './Navbar.css';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const handleHamburgerClick = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="navbar">
      <div className="nav-container">
        <div className="nav-logo">
          {/* You can place your logo here */}
          <Link to="hero" smooth={true} duration={500}>
            Avi Desai
          </Link>
        </div>
        <ul className={`nav-menu ${isOpen ? 'active' : ''}`}>
          <li className="nav-item">
            <Link
              to="hero"
              smooth={true}
              duration={500}
              spy={true}
              activeClass="active"
              offset={-50}
              onClick={() => setIsOpen(false)}
            >
              Home
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="bio"
              smooth={true}
              duration={500}
              spy={true}
              activeClass="active"
              offset={-50}
              onClick={() => setIsOpen(false)}
            >
              Bio
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="experience"
              smooth={true}
              duration={500}
              spy={true}
              activeClass="active"
              offset={-50}
              onClick={() => setIsOpen(false)}
            >
              Experience
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="projects"
              smooth={true}
              duration={500}
              spy={true}
              activeClass="active"
              offset={-50}
              onClick={() => setIsOpen(false)}
            >
              Projects
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="contact"
              smooth={true}
              duration={500}
              spy={true}
              activeClass="active"
              offset={-50}
              onClick={() => setIsOpen(false)}
            >
              Contact
            </Link>
          </li>
        </ul>
        <div className="hamburger-menu" onClick={handleHamburgerClick}>
          <span className="bar"></span>
          <span className="bar"></span>
          <span className="bar"></span>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
